import React from 'react';
import Flip from './flip';

const FlipContainer = ({ cards }) => {
  return (
    <div className="flex h-[100%] w-[100%] flex-col md:flex-row md:flex-wrap justify-center items-center max-w-6xl mx-auto py-8 my-24">
      {cards?.map((card) => (
        <Flip
          {...card}
          key={card.id}
          title={card.title}
          descriptionFront={card.descriptionFront}
          descriptionBack={card.descriptionBack}
          imageSrc={card.imageSrc}
        />
      ))}
    </div>
  );
};

export default FlipContainer ;
